import React from 'react';
import { useNavigate } from 'react-router-dom';
import './MainPage.css';

const MainPage = () => {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    navigate('/function'); // Navigate to the function page
  };

  return (
    <div>
      <h1>Welcome to </h1>
      <div class="artistic-word">
        <div class="scattered-letters">
          <span>C</span>
          <span>o</span>
          <span>l</span>
          <span>l</span>
          <span>e</span>
          <span>c</span>
          <span>t</span>
        </div>
        <span>t</span>
        <span>P</span>
        <span>i</span>
        <span>e</span>
      </div>
      <p>Your ultimate tool for collecting, managing, and mastering words and phrases from around the world.</p>
      <button onClick={handleButtonClick}>Get Started</button>
    </div>
  );
};

export default MainPage;
